    [description] => Trova subito il distributore di benzina pi economico vicino a tePrezzi Benzina (ex AndroidFuel)  lapplicazione per trovare in Italia i distributori di Benzina, Diesel, Metano e GPL con i migliori prezzi.Prezzi Benzina  un progetto collaborativo basato sulle segnalazioni del portale web Prezzi Benzina.Alcune delle funzioni che il programma offre: Gestione di Benzina, Diesel, Metano e GPL Visualizzazione dei benzinai in base ai dati GPS o in base ad un indirizzo inserito Visualizzazione dei prezzi del distributore e, in caso di dati non aggiornati, visualizzazione del prezzo medio della compagnia Navigazione con GPS verso ogni distributore Media dei prezzi nazionali di ogni compagnia Possibilit di inviare aggiornamenti sui prezzi Gestione dei distributori preferiti Installazione sulla SDSono presenti sia i distributori indipendenti ("Pompe Bianche" o "no logo") che i distributori dei grossi marchi: Eni, IP, Esso, Q8, Shell, Tamoil, TotalErg e altriPoich i prezzi sono inseriti principalmente da volontari, non sempre sono aggiornati o disponibili; se trovi un prezzo sbagliato collabora segnalando quello corretto: la qualit del servizio migliora con la collaborazione di ogni singolo utente.Se trovi un malfunzionamento o un errore non lasciare un feedback negativo, ma scrivi a info@androidfuel.org: faremo il possibile per correggerlo.Prezzi Benzina  un marchio registrato di propriet di DuePuntoUno S.r.l. e nasce dall'esperienza del portale PrezziBenzina.it.---Alcune note:- i colori dei distributori nella mappa variano dal verde al rosso per indicare i distributori pi convenienti nella zona visualizzata. Cambiando livello di zoom i colori cambiano poich si riferiscono alla nuova zona visualizzata-  possibile indicare i prezzi notturni o durante il week-end inserendo come tipo di servizio "Self da chiuso"- le offerte Yoodeal sono momentaneamente disabilitate per motivi tecniciSuggerimenti, commenti e bug possono essere segnalati all'indirizzo info@androidfuel.org
